# Regime switching Heston stochastic volatility model 

Consider the Heston stochastic volatility model

$$
\begin{aligned}
d S_{t} & =r S_{t} d t+\sqrt{v_{t}} S_{t} d W_{t}^{1} \\
d v_{t} & =\kappa\left(\gamma-v_{t}\right) d t+\sigma_{X_{t}} \sqrt{v_{t}} d W_{t}^{2}
\end{aligned}
$$

The Monte Carlo method for pricing European put options using the above SDE is as follows

- Discretise the above equations using the Euler Maruyama scheme

$$
\begin{aligned}
& S_{i+1}=r S_{i} \delta t+\sqrt{v_{i}} S_{i} \Delta W_{i}^{1} \\
& v_{i+1}=\kappa\left(\gamma-v_{i}\right) \delta t+\sigma_{X_{i}} \max \left\{\sqrt{v_{i}}, 0\right\} \Delta W_{i}^{2}
\end{aligned}
$$

where $X_{i} \in\{1,2\}$.

- Generate N different realisations of $\left\{S_{t}\right\}_{0 \leq t \leq T_{\max }}$ and $\left\{v_{t}\right\}_{0 \leq t \leq T_{\max }}$ upto time $T_{\max }$ using the initial price $S_{0}$, initial volatility $v_{0}$ and initial regime $l \in\{1,2\}$. Let $S^{j l}=\left\{S_{t}^{j l} \mid 0 \leq\right.$ $\left.t \leq T_{\max }\right\}_{j=1}^{N}$, be the $N$ different realisations of stock prices with initial regime $l$.
- Using the generated paths evaluate $N$ different realisations of the payoff, i.e. $P_{t_{0}}^{j l}=$ $\max \left\{0, E-S_{t_{0}}^{j l}\right\}$ at time $T=t_{0}$.
- The put option price in $l^{\text {th }}$ regime with time to maturity $\tau=T-t=t_{0}$ is calculated as the average discounted payoff across all the $N$ realisations of the payoffs, i.e.

$$
P^{l}\left(t_{0}\right)=e^{-r t_{0}} \frac{1}{N} \sum_{j=1}^{N} P_{t_{0}}^{l j}
$$
